script: |
  super -f text -I q7411.spq | sort > q7411.out

inputs:
  - name: q7411.spq
    data: |
      SELECT + col2 + col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN col2 AND col1 * - col1 * - col2 + + + 58 + + - col2 * col0 + - 34;
  - name: tab0

outputs:
  - name: q7411.out
    data: |
